import React from 'react'
import '../Styles/dashbord.css'
import backgroundImage from  '../Assets/Logo Gnagna.png'

const Dashboard = () => {
  return (
    <div className='event-banner-shape'>
        <img className='event-banner' src={backgroundImage} alt='backgroundImage'/>  
    </div>
  )
}

export default Dashboard
